INSERT INTO `wp_comments` VALUES (3,239,'admin','nobody@bocoup.com','','108.35.22.74','2016-01-04 20:08:46','2016-01-04 20:08:46','Excellent example!',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:44.0) Gecko/20100101 Firefox/44.0','',0,2),(4,382,'dkong','dkong@mit.edu','','129.55.200.20','2016-04-05 20:16:48','2016-04-05 20:16:48','Sweet! This looks great Ryan!',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.9; rv:45.0) Gecko/20100101 Firefox/45.0','',0,18),(5,254,'carbonboy','palumbojacob@gmail.com','','50.43.44.2','2016-10-19 06:27:07','2016-10-19 06:27:07','Where are downloads for this part available at?',0,'1','Mozilla/5.0 (X11; Ubuntu; Linux x86_64; rv:49.0) Gecko/20100101 Firefox/49.0','',0,67),(7,542,'Tanaami','tanaani@gmail.com','','189.46.62.83','2017-06-08 00:37:57','2017-06-08 04:37:57','What solenoid valves did you use?',0,'1','Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/59.0.3071.86 Safari/537.36','',0,129),(8,382,'Zim','simkbh@gmail.com','','188.178.153.190','2017-06-15 01:13:08','2017-06-15 05:13:08','Schematic for wiring arduino and driver would be nice.',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.12; rv:53.0) Gecko/20100101 Firefox/53.0','',0,212),(9,542,'MakerTobey','wenzel.science@gmail.com','','128.232.255.41','2017-06-17 13:28:40','2017-06-17 17:28:40','Thanks for sharing this prototype, the device and instructions look amazing. It would be great to see the documentation even more presentable, modular and interactive by using DocuBricks: www.docubricks.org . Perhaps the DocuBricks format could even be supported in the Metafluidics repository.\r\nYou should also consider publishing it in the Journal of Open Hardware: www.journalofopenhardware.org ! \r\nI will make sure to share my feedback when trying to assemble and learn from the device in a couple of months.',0,'1','Mozilla/5.0 (Windows NT 10.0; WOW64; rv:54.0) Gecko/20100101 Firefox/54.0','',0,281),(10,382,'MakerTobey','wenzel.science@gmail.com','','128.232.255.41','2017-06-17 13:31:39','2017-06-17 17:31:39','Hi - have you made any improvements over the published OpenSyringePump? http://journals.plos.org/plosone/article?id=10.1371/journal.pone.0107216 \r\nIf so, you should consider publishing it in the Journal of Open Hardware: www.journalofopenhardware.org !',0,'1','Mozilla/5.0 (Windows NT 10.0; WOW64; rv:54.0) Gecko/20100101 Firefox/54.0','',0,281),(11,254,'MakerTobey','wenzel.science@gmail.com','','128.232.255.41','2017-06-17 13:34:03','2017-06-17 17:34:03','Hi, this looks like a great chip design! Does it work and is it characterised? If so, you should consider publishing it in the Journal of Open Hardware: www.journalofopenhardware.org !',0,'1','Mozilla/5.0 (Windows NT 10.0; WOW64; rv:54.0) Gecko/20100101 Firefox/54.0','',0,281),(12,441,'MakerTobey','wenzel.science@gmail.com','','128.232.255.41','2017-06-17 13:38:06','2017-06-17 17:38:06','I\'m looking forward to manuscript status updates for publication in the Journal of Open Hardware www.journalofopenhardware.org :-)',0,'1','Mozilla/5.0 (Windows NT 10.0; WOW64; rv:54.0) Gecko/20100101 Firefox/54.0','',0,281),(13,393,'MakerTobey','wenzel.science@gmail.com','','128.232.255.41','2017-06-17 13:41:53','2017-06-17 17:41:53','That looks really fantastic, David! It would be great to see one of your useful designs submitted to the Journal of Open Hardware (www.journalofopenhardware.org)',0,'1','Mozilla/5.0 (Windows NT 10.0; WOW64; rv:54.0) Gecko/20100101 Firefox/54.0','',0,281),(14,393,'dkong','dkong@mit.edu','','88.128.80.212','2017-06-17 21:23:01','2017-06-18 01:23:01','Thanks MakerTobey! Is it OK to submit even if the part is already discussed in the Nature Biotech article?',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.12; rv:54.0) Gecko/20100101 Firefox/54.0','',13,18),(15,542,'thorsen','thorsen@ll.mit.edu','','73.61.23.157','2017-06-18 20:19:57','2017-06-19 00:19:57','We use Solenoid valves from the Lee Company. Per the Instructions download, we used \"32 High Density Interface (HDI) 3-way solenoid valves 12V 15psi (The Lee Company, LHDA1221111H)\".',0,'1','Mozilla/5.0 (iPhone; CPU iPhone OS 10_3_2 like Mac OS X) AppleWebKit/603.2.4 (KHTML, like Gecko) Version/10.0 Mobile/14F89 Safari/602.1','',7,20),(16,542,'thorsen','thorsen@ll.mit.edu','','73.61.23.157','2017-06-18 20:22:43','2017-06-19 00:22:43','Thanks for the great feedback. I hope to upload plans for our more advanced touchscreen version soon. I will definitely check out the Journal of Open Hardware. Sounds like a nice fit for the project.',0,'1','Mozilla/5.0 (iPhone; CPU iPhone OS 10_3_2 like Mac OS X) AppleWebKit/603.2.4 (KHTML, like Gecko) Version/10.0 Mobile/14F89 Safari/602.1','',9,20),(17,397,'fschmidmichels','fschmidmichels@physik.uni-bielefeld.de','','129.70.125.33','2017-06-22 10:04:44','2017-06-22 14:04:44','Interesting shape, how does it work?',0,'1','Mozilla/5.0 (Windows NT 6.1; WOW64; rv:53.0) Gecko/20100101 Firefox/53.0','',0,390),(18,397,'Roberto Gallo','fablabzoi@gmail.com','','186.101.171.62','2017-06-23 18:35:40','2017-06-23 22:35:40','Here more info http://bio.academany.org/labs/fablabyachay-urcuqui/students/Roberto/13w.html',0,'1','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/58.0.3029.110 Safari/537.36','',17,80),(19,571,'dkong','dkong@mit.edu','','18.111.15.128','2017-07-03 16:01:13','2017-07-03 20:01:13','Awesome!! Thanks for sharing :)',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.12; rv:54.0) Gecko/20100101 Firefox/54.0','',0,18),(20,367,'dAcid','mironandrzej1@gmail.com','','94.194.39.30','2017-07-30 06:22:37','2017-07-30 10:22:37','What were your laser settings?\r\nHow did you achieve the required depth?',0,'1','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/59.0.3071.115 Safari/537.36','',0,589),(21,617,'physnano','physnano@gmail.com','','69.74.14.178','2017-08-15 09:50:34','2017-08-15 13:50:34','8/15/17 - Updated the build manual (v12) to have higher RES images, user manual is also found in the design files   -Will',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',0,602),(22,617,'Munachi','ernest-eze1869@loyolajesuit.org','','197.210.28.51','2017-08-19 21:36:59','2017-08-20 01:36:59','This is a really interesting field. Does micro fluidics support Computers',0,'1','Mozilla/5.0 (iPad; CPU OS 9_3_2 like Mac OS X) AppleWebKit/601.1 (KHTML, like Gecko) CriOS/52.0.2743.84 Mobile/13F69 Safari/601.1.46','',0,538),(23,617,'physnano','physnano@gmail.com','','69.74.14.178','2017-08-24 09:04:14','2017-08-24 13:04:14','8/24/17 - I will be updating the electronics to allow for faster flow rates and thus reduced [Drop-seq] run time. The BOM and new instructions on electronics modification will be updated in the Build Manual. Look for these updates in the coming week. -Will',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',0,602),(24,617,'physnano','physnano@gmail.com','','69.74.14.178','2017-08-24 09:19:17','2017-08-24 13:19:17','Not really sure what you are asking here. Microfluidics deals with the precise manipulation of fluids at the micron scale. These systems can interface with computers to perform fluid control operations, a prime example being this project and other projects on the Metafluidics repository.',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',22,602),(25,617,'physnano','physnano@gmail.com','','69.74.14.178','2017-08-29 16:52:07','2017-08-29 20:52:07','8/29/17 - I have updated the BOM and Build manual. Two electronic components were replaced (IC3 and R5 on PCB). See the BOM for details.\r\n-Will',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',0,602),(26,617,'taduncombe','taduncombe@gmail.com','','12.219.129.12','2017-09-13 11:32:13','2017-09-13 15:32:13','You should consider submitting a manuscript focused on the hardware construction and characterization to HardwareX, it would be a great fit.\r\nhttps://www.journals.elsevier.com/hardwarex/\r\ncheers,\r\nTodd',0,'1','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/60.0.3112.113 Safari/537.36','',0,705),(27,617,'as1067','cyrus.tau@gmail.com','','98.248.94.77','2017-10-07 01:40:52','2017-10-07 05:40:52','How large are the droplets (diameter) created from the chip?\r\n\r\nThanks,\r\nCyrus',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/61.0.3163.100 Safari/537.36','',0,681),(28,617,'physnano','physnano@gmail.com','','69.74.14.178','2017-10-10 09:40:06','2017-10-10 13:40:06','Hi Cyrus,\r\n\r\nThe droplet size is dictated by the microfluidic chip used and the pressures. Both are adjustable! Typically using the modified \"Drop-seq\" chip I can get droplet sizes up to about 130um (diameter). Personally I haven\'t had a reason to go much larger than that. \r\n\r\n-Will',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',0,602),(29,617,'physnano','physnano@gmail.com','','69.74.14.178','2017-10-10 09:42:45','2017-10-10 13:42:45','10/10/17 – Updated the bill of materials (BOM). There was an error on one of the parts: Honeywell TruStability pressure sensor. The correct part number is SSCDLNN015PGAA5-ND and can be found at the following link:\r\nhttps://www.digikey.com/products/en?keywords=SSCDLNN015PGAA5-ND\r\n-Will',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',0,602),(30,617,'as1067','cyrus.tau@gmail.com','','108.89.32.161','2017-10-11 23:23:58','2017-10-12 03:23:58','Thanks so much!\r\nI was thinking about modifying the miniDrops system to encapsulate hemoglobin in a membrane and I was wondering about the best way to contact you to ask more questions about it.\r\n\r\nThanks again,\r\nCyrus',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/61.0.3163.100 Safari/537.36','',28,681),(31,617,'dkong','dkong@mit.edu','','205.154.255.174','2017-10-16 18:31:45','2017-10-16 22:31:45','Amazing! Thank you for sharing this!',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.12; rv:56.0) Gecko/20100101 Firefox/56.0','',0,18),(32,254,'adamj','joulesgroup@gmail.com','','67.133.248.131','2017-10-26 08:07:15','2017-10-26 12:07:15','This device was published in a journal in 2007; Nucleic Acids Research, \"Parallel gene synthesis in a microfluidic device\".  It is openly available though National Center for Biotechnology Information (NCBI) but it does not contain supporting info:\r\nhttps://www.ncbi.nlm.nih.gov/pmc/articles/PMC1885655/pdf/gkm121.pdf',0,'1','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/61.0.3163.100 Safari/537.36','',0,813),(33,617,'physnano','physnano@gmail.com','','69.74.14.178','2017-11-16 17:18:19','2017-11-16 22:18:19','11/16/17 - Updated the bill of materials (BOM) to v4. Corrected the part number for the Airtrol regulators (part 7) and removed ambiguous pre-part number for mx7 solenoid valve. Parker Hannifin precision fluidics may have altered the solenoid valve part number and I will check back for the correct configuration (product number)',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',0,602),(34,617,'physnano','physnano@gmail.com','','69.74.14.178','2017-11-16 17:19:02','2017-11-16 22:19:02','No problem! Thanks for building the repository!',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',31,602),(35,617,'physnano','physnano@gmail.com','','100.38.3.38','2017-11-19 09:00:10','2017-11-19 14:00:10','Just a suggestion to those interested in building the instrument: The PCB required for this instrument is a 4-layer board and can be pricey if bought at quantity 1. The more PCBs ordered, the lower the individual board cost. I would suggest connecting on this forum to make a group order of the circuit boards to save money. Also feel free to shop around at different PCB manufacturers for the best price.\r\n\r\n-Will',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',0,602),(36,617,'physnano','physnano@gmail.com','','69.74.14.178','2018-02-27 14:17:25','2018-02-27 19:17:25','2/27/18 - Updated the User_manual to v2. Changed PE2 to PE3 in the \'you will also need\' section. PE3 is the correct tubing to be used with this instrument for the given New England Small Tube stainless steel tubing, NOT PE2.',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',0,602),(37,617,'Benjamin Yellen','yellen@duke.edu','','152.3.43.21','2018-03-02 09:20:16','2018-03-02 14:20:16','Hi, I can\'t seem to find the diagram for the PCB board.  Where is this file located and how do I order one of these?',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_12_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/64.0.3282.167 Safari/537.36','',0,1106),(38,617,'physnano','physnano@gmail.com','','69.74.14.178','2018-03-02 09:31:55','2018-03-02 14:31:55','Hi Benjamin,\r\n\r\nThe PCB is contained in the \"mDSv15-Gerber-files-4-layer-sfe-CAM\" files, you could order the PCB from almost any PCB manufacturer that has the ability to make 4-layer boards such as OSH Park, Royal Circuit Solutions, Ecpress PCB, etc. It may be more cost effective to reach out to others interested in purchasing PCBs as they typically take orders for 3 or more boards.\r\n\r\n-Will',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:53.0) Gecko/20100101 Firefox/53.0','',37,602),(39,617,'Scott Noggle','snoggle@nyscf.org','','72.43.99.187','2018-04-17 14:25:54','2018-04-17 18:25:54','Hi Will,\r\n\r\nI\'m making good progress building the device.  Is there a vendor that already has the mDS microfluidic chip of your design ready made?  Alternatively, have you tested the designs from the McCarroll lab (e.g. ready made chips from Nanoshift)?\r\n\r\nThanks!\r\nScott',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_12_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15','',0,1061),(40,617,'physnano','physnano@gmail.com','','69.74.14.178','2018-04-17 15:12:15','2018-04-17 19:12:15','Hi Scott,\r\nIf you intend to perform Drop-seq, the chips from McCarroll lab will not work with this system. The cost of instrument miniaturization is that the two aqueous flows (i.e. cells and microparticles) are controlled with the same pressure source and thus require a chip that has equal hydrodynamic resistance for these channels before encapsulation into droplets. This is not the case for the McCarroll design which was intended to be used with three independently addressable syringe pumps. \r\nAs for vendors I do not know of any company that has made the chips yet. I would think Nanoshift can easily fabricate the design used here (mDS_v12.dwg) as it is a nearly identical process to that of making the McCarroll style chips (just different design). We typically can fit 12 individual devices (4, 3-device squares) on a 3-inch wafer with spacing such that each 3-device pattern can fit in the center of a standard microscope slide (3\"x1\"). I can explain further if you require more details.\r\n\r\n-Will',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10.12; rv:58.0) Gecko/20100101 Firefox/58.0','',39,602),(41,942,'YJ','674576408@139.com','','124.65.50.166','2018-06-08 00:53:15','2018-06-08 04:53:15','digital microfluidics can make droplet much more precision',0,'1','Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/55.0.2883.87 Safari/537.36','',0,1368),(42,460,'mohsaber','mohamed.sr.ibrahim@gmail.com','','50.39.161.194','2018-06-12 12:28:42','2018-06-12 16:28:42','This is an awesome website! Hope it becomes more active. \r\n\r\nThank you.',0,'1','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_13_4) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36','',0,897);
