(1320,373,'_wp_attachment_metadata','a:1:{s:8:\"filesize\";i:489351;}'),(1321,374,'metafluidics-device-description','A microfluidic valve can be used to proportionally control fluid flow. Applied fluidic pressure to the control channel closes the flow channel. This valve when printed on an Objet Connex500 with a flexible material for the membrane, TangoPlus (FLX930), and a stiff material for the structure channel, VeroWhitePlus (RGD835), closes at approximately 30 PSI control pressure. For more details, please see http://matter.media.mit.edu/tools/details/multimaterial-3d-printed-valve'),(1322,374,'metafluidics-device-thumbnail','371'),(1323,374,'metafluidics-device-images','372'),(1324,374,'metafluidics-device-design-files','373'),(1325,374,'metafluidics-device-software',''),(1326,374,'metafluidics-device-bill-of-materials',''),(1327,374,'metafluidics-device-publications',''),(1328,374,'metafluidics-device-tutorials',''),(1329,374,'metafluidics-device-remixed',''),(1330,374,'metafluidics-device-parts',''),(1331,374,'metafluidics-device-views','0'),(1332,374,'_edit_lock','1495860123:18'),(1333,374,'metafluidics-device-build-instructions',''),(1334,374,'metafluidics-device-likes','3'),(1335,374,'metafluidics-device-downloads-total','27'),(1336,374,'_edit_last','18'),(1337,338,'_edit_lock','1464134411:29'),(1338,338,'metafluidics-device-build-instructions',''),(1339,373,'metafluidics-device-downloads','27'),(1340,377,'_wp_attached_file','2016/04/IMG_3316.jpg'),(1341,377,'amazonS3_info','a:3:{s:6:\"bucket\";s:18:\"metafluidics-stage\";s:3:\"key\";s:48:\"wp-content/uploads/2016/04/05182551/IMG_3316.jpg\";s:6:\"region\";s:0:\"\";}'),(1342,377,'wpos3_filesize_total','1637242'),(1343,377,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:2448;s:6:\"height\";i:2448;s:4:\"file\";s:20:\"2016/04/IMG_3316.jpg\";s:5:\"sizes\";a:7:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:20:\"IMG_3316-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"m