can change any of the available parameters to design a new test device using OpenScad, and open source CAD tool. </p>'),(3538,896,'metafluidics-device-thumbnail','894'),(3539,896,'metafluidics-device-images','895,897,898'),(3540,896,'metafluidics-device-design-files','892'),(3541,896,'metafluidics-device-software',''),(3542,896,'metafluidics-device-bill-of-materials',''),(3543,896,'metafluidics-device-publications','[{\"name\":\"Desktop Micromilled Microfluidics\",\"url\":\"https://link.springer.com/article/10.1007/s10404-018-2048-2\"}]'),(3544,896,'metafluidics-device-tutorials',''),(3545,896,'metafluidics-device-remixed',''),(3546,896,'metafluidics-device-parts',''),(3547,896,'metafluidics-device-views','0'),(3548,896,'_edit_lock','1519858771:828'),(3549,896,'metafluidics-device-build-instructions',''),(3550,896,'metafluidics-device-likes','1'),(3551,896,'metafluidics-device-downloads-total','18'),(3552,897,'_wp_attached_file','2018/02/dool.png'),(3553,897,'amazonS3_info','a:3:{s:6:\"bucket\";s:18:\"metafluidics-stage\";s:3:\"key\";s:44:\"wp-content/uploads/2018/02/28174314/dool.png\";s:6:\"region\";s:0:\"\";}'),(3554,897,'wpos3_filesize_total','5251341'),(3555,897,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:2620;s:6:\"height\";i:1562;s:4:\"file\";s:16:\"2018/02/dool.png\";s:5:\"sizes\";a:7:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:16:\"dool-150x150.png\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:9:\"image/png\";}s:6:\"medium\";a:4:{s:4:\"file\";s:16:\"dool-300x179.png\";s:5:\"width\";i:300;s:6:\"height\";i:179;s:9:\"mime-type\";s:9:\"image/png\";}s:12:\"medium_large\";a:4:{s:4:\"file\";s:16:\"dool-768x458.png\";s:5:\"width\";i:768;s:6:\"height\";i:458;s:9:\"mime-type\";s:9:\"image/png\";}s:5:\"large\";a:4:{s:4:\"file\";s:17:\"dool-1024x610.png\";s:5:\"width\";i:1024;s:6:\"height\";i:610;s:9:\"mime-type\";s:9:\"image/png\";}s:17:\"archive-thumbnail\";a:4:{s:4:\"file\";s:16:\"dool-400x300.png\";s:5:\"width\";i:400;s:6:\"height\";i:300;s:9:\"mime