s)</p>\r\n<p class=\"MsoNoSpacing\" style=\"text-indent: .5in;\">Surface features:  40 to 440 µm in steps of 40 µm (11 features)</p>\r\n<p class=\"MsoNoSpacing\"> </p>\r\n<p class=\"MsoNoSpacing\"><u>50% scaled up version:</u></p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: .5in;\">Overall dimensions:  22.5 x 22.5 mm</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: .5in;\">Channels:  60 to 420 µm in steps of 60 µm</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: .5in;\">Surface features:  60 to 660 µm in steps of 60 µm</p>\r\n<p class=\"MsoNoSpacing\"> </p>\r\n<p class=\"MsoNoSpacing\"><u>Available files (in the zip folder):</u></p>\r\n<p class=\"MsoNoSpacing\">Import with <i>millimeter</i> dimensions</p>\r\n<p class=\"MsoNoSpacing\">STL</p>\r\n<p class=\"MsoNoSpacing\">IGES/IGS</p>\r\n<p class=\"MsoNoSpacing\">STEP</p>\r\n<p>&nbsp;</p>\r\n<p>The sample print shown was printed on a Form 2 in the University of Minnesota Anderson Student Innovation Labs (thanks to Ben)</p>'),(3887,952,'metafluidics-device-thumbnail','957'),(3888,952,'metafluidics-device-images','958,950,949,948'),(3889,952,'metafluidics-device-design-files','951'),(3890,952,'metafluidics-device-software',''),(3891,952,'metafluidics-device-bill-of-materials',''),(3892,952,'metafluidics-device-publications',''),(3893,952,'metafluidics-device-tutorials',''),(3894,952,'metafluidics-device-remixed',''),(3895,952,'metafluidics-device-parts',''),(3896,952,'metafluidics-device-views','0'),(3897,952,'_edit_lock','1528663567:813'),(3898,952,'metafluidics-device-build-instructions',''),(3899,952,'metafluidics-device-likes','0'),(3900,952,'metafluidics-device-downloads-total','4'),(3901,953,'_wp_attached_file','2018/06/CAD-Image-11.png'),(3902,953,'amazonS3_info','a:3:{s:6:\"bucket\";s:18:\"metafluidics-stage\";s:3:\"key\";s:52:\"wp-content/uploads/2018/06/10161157/CAD-Image-11.png\";s:6:\"region\";s:0:\"\";}'),(3903,953,'wpos3_filesize_total','1107654'),(3904,953,'_wp_attachment_metadata','a:6:{s