 23:15:19','2016-01-26 23:15:19','Small microfluidic chip to grow bacteria on it. It has only one inlet and one outlet (miniluer size). The shape of the channel is inspired in the villi of the gut. The smalls islands pretend to trap the bacteria and protect small communities from the constant flux. The chip has the same size as the normal microscope slides.','Microfluidics Villi-Like','','publish','open','closed','','microfluidics-villi-like','','','2016-01-26 23:15:19','2016-01-26 23:15:19','',0,'http://metafluidics.wpengine.com/devices/microfluidics-villi-like/',0,'metafluidics_device','',0),(371,51,'2016-01-30 05:15:58','2016-01-30 05:15:58','','SJK_5152','','inherit','open','closed','','sjk_5152','','','2016-01-30 05:15:58','2016-01-30 05:15:58','',0,'http://metafluidics.wpengine.com/wp-content/uploads/2016/01/SJK_5152.jpg',0,'attachment','image/jpeg',0),(372,51,'2016-01-30 05:17:14','2016-01-30 05:17:14','','CAD figure','','inherit','open','closed','','cad-figure','','','2016-01-30 05:17:14','2016-01-30 05:17:14','',0,'http://metafluidics.wpengine.com/wp-content/uploads/2016/01/CAD-figure.png',0,'attachment','image/png',0),(373,51,'2016-01-30 05:18:53','2016-01-30 05:18:53','','Single multimaterial valve','','inherit','open','closed','','single-multimaterial-valve','','','2016-01-30 05:18:53','2016-01-30 05:18:53','',0,'http://metafluidics.wpengine.com/wp-content/uploads/2016/01/Single-multimaterial-valve.zip',0,'attachment','application/zip',0),(374,51,'2016-01-30 05:19:51','2016-01-30 05:19:51','A microfluidic valve can be used to proportionally control fluid flow. Applied fluidic pressure to the control channel closes the flow channel. This valve when printed on an Objet Connex500 with a flexible material for the membrane, TangoPlus (FLX930), and a stiff material for the structure channel, VeroWhitePlus (RGD835), closes at approximately 30 PSI control pressure. For more details, please see http://matter.media.mit.edu/tools/details/multimaterial-3d-printed-va