-12.06.16-AM.png',0,'attachment','image/png',0),(452,20,'2017-05-27 04:14:56','2017-05-27 04:14:56','','25x40-ctrlSRL470','','inherit','open','closed','','25x40-ctrlsrl470','','','2017-05-27 04:14:56','2017-05-27 04:14:56','',0,'http://metafluidics.org/wp-content/uploads/2017/05/25x40-ctrlSRL470.tiff',0,'attachment','image/tiff',0),(453,20,'2017-05-27 04:14:58','2017-05-27 04:14:58','','25x40-flowSRL4','','inherit','open','closed','','25x40-flowsrl4','','','2017-05-27 04:14:58','2017-05-27 04:14:58','',0,'http://metafluidics.org/wp-content/uploads/2017/05/25x40-flowSRL4.tiff',0,'attachment','image/tiff',0),(456,20,'2017-05-27 04:32:42','2017-05-27 04:32:42','We developed high-density microfluidic chips that contain plumbing networks with thousands of micromechanical valves and hundreds of individually addressable chambers. These fluidic devices are analogous to electronic integrated circuits fabricated using large-scale integration. A key component is the fluidic multiplexor, which is a combinatorial array of binary valve patterns that exponentially increases network processing power by allowing complex fluid manipulations with minimal inputs.','Microfluidic Large-Scale Integration','','publish','open','closed','','microfluidic-large-scale-integration','','','2017-06-07 05:18:25','2017-06-07 09:18:25','',0,'http://metafluidics.org/devices/microfluidic-large-scale-integration/',0,'metafluidics_device','',0),(460,18,'2017-05-27 05:00:38','2017-05-27 05:00:38','Thank you for visiting Metafluidics! We hope you will join our community of microfluidic makers, practitioners, and enthusiasts.\r\n\r\nMetafluidics was built to provide a home for digital design files and all of the other information necessary to reproduce or remix a microfluidic device. Please create a profile for yourself and peruse the repository! There are devices and parts for you to make, and also a simple interface for you to add your own. We hope that this repository will inspire both veteran microfluidic experts and a whole new generation microfluidic makers and users.\r\n\r\nAs part of the launching of Metafluidics, we are excited to feature a collection of fluidic parts from one of the pioneers of the field of microfluidics, Dr. Todd Thorsen. Todd\'s papers have been cited thousands of times, and we are thrilled to present the <a href=\"http://metafluidics.org/thorsen-collection/\"><strong>Thorsen Collection</strong></a>, a selection of microfluidic devices and original design files from his published repertoire. Going forward we are excited to add collections from other microfluidic makers!\r\n\r\nYou can follow us on social media via <a href=\"https://www.instagram.com/metafluidics/\"><strong>Instagram</strong></a>, <a href=\"https://www.twitter.com/metafluidics/\"><strong>Twitter</strong></a>, and <a href=\"https://www.facebook.com/metafluidics\"><strong>Facebook</strong></a>. You can also read the recently released <a href=\"http://www.nature.com/nbt/journal/v35/n6/full/nbt.3873.html\"><strong>Nature Biotechnology paper on Metafluidics</strong></a>.\r\n\r\nCheers and we look forward to your participation in the Metafluidics community!','Welcome to Metafluidics!','','publish','open','closed','','welcome-to-metafluidics','','','2017-06-12 04:56:06','2017-06-12 08:56:06','',0,'http://metafluidics.org/?p=460',0,'post','',1),(462,18,'2017-05-27 05:21:38','2017-05-27 05:21:38','We are privileged to have, as part of the launch of Metafluidics, a curated collection of microfluidic designs from one of the pioneers of microfluidics, Dr. Todd Thorsen. Todd\'s contributions to the field include co-developing the first microfluidic valve, demonstrating the first large-scale integration circuit, and also the first droplet generator.\r\n\r\nThe fluidic parts from this collection include:\r\n<ul>\r\n 	<li><a href=\"http://metafluidics.org/devices/microfluidic-large-scale-integration/\"><strong>Microfluidic Large-Scale Integration</strong></a></li>\r\n 	<li><strong><a href=\"https://metafluidics.org/devices/microfluidic-oxygenator/\">Microfluidic Oxygenator</a></strong></li>\r\n 	<li><strong><a href=\"https://metafluidics.org/devices/microfluidic-artificial-teeth-device/\">Microfluidic \'Artificial Teeth\' Device</a></strong></li>\r\n 	<li><strong><a href=\"https://metafluidics.org/devices/32-channel-controller/\">32-Channel Controller</a></strong></li>\r\n</ul>\r\nWe will continue to add to this collection over time. Enjoy the fluidic parts and we hope you will remix them and upload your own versions!','Thorsen Collection','','publish','open','closed','','thorsen-collection','','','2017-06-07 04:48:40','2017-06-07 08:48:40','',0,'http://metafluidics.org/?p=462',0,'post','',0),(465,18,'2017-05-29 23:53:33','2017-05-29 23:53:33','','twitter1','','inherit','open','closed','','twitter1','','','2017-05-29 23:53:33','2017-05-29 23:53:33','',0,'http://metafluidics.org/wp-content/uploads/2017/05/twitter1.png',0,'attachment','image/png',0),(466,18,'2017-05-29 23:53:53','2017-05-29 23:53:53','','instagram-clipart-transparent-background-25.jpg','','inherit','open','closed','','instagram-clipart-transparent-background-25-jpg','','','2017-05-29 23:53:53','2017-05-29 23:53:53','',0,'http://metafluidics.org/wp-content/uploads/2017/05/instagram-clipart-transparent-background-25.jpg.png',0,'attachment','image/png',0),(471,18,'2017-05-30 14:55:25','2017-05-30 14:55:25','','Print','','inherit','open','closed','','print','','','2017-05-30 14:55:25','2017-05-30 14:55:25','',0,'http://metafluidics.org/wp-content/uploads/2017/05/Free-Communication-Icon-Vector-03.jpg',0,'attachment','image/jpeg',0),(475,18,'2017-05-30 20:31:44','2017-05-30 20:31:44','','facebook-logo','','inherit','open','closed','','facebook-logo','','','2017-05-30 20:31:44','2017-05-30 20:31:44','',0,'http://metafluidics.org/wp-content/uploads/2017/05/facebook-logo.png',0,'attachment','image/png',0),(476,18,'2017-05-30 20:40:31','2017-05-30 20:40:31','','facebook-dreamstale25','','inherit